import './Switch.css';

const Switch1 = () => {
  return (
    <>
      <input
        className="react-switch-checkbox"
        id={`react-switch-new`}
        type="checkbox"
      />
     <label
  style={{ background: isOn && '#06D6A0' }}
  className="react-switch-label"
  htmlFor={`react-switch-new`}
>
        <span className={`react-switch-button`} />
      </label>
    </>
  );
};

export default Switch1;
